        N_copy = N
        ret = []
        while N > 0:
            l = len(bin(N)) - 2
            start = (1 << l) - 1 - N
            ret += list(range(start, N + 1))
            N = start - 1
        return (list(range(N_copy, 0, -1)), ret)
    else:
        return -1

